# coding=utf-8def main():    n, k = map(int, raw_input().split())    fib = [1, 1]    for i in range(2, n + 1):        fib.append(fib[-2] + fib[-1])    rst = []    i = 1    while i <= n:        todo = n - i        if i <= n - 1 and k > fib[todo]:  # 我把下标换成了1开始之后没有修改这个地方            k -= fib[todo]            rst.extend([i + 1, i])            i += 2        else:            rst.append(i)            i += 1    # print k, rst    print reduce(lambda x, y: str(x) + ' ' + str(y), rst)  main()
